import React from 'react';
import Characters from './components/Characters';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'; // Importe as funcionalidades de roteamento
import { Provider } from 'react-redux';
import { store } from './utils/store';

function App() {
  return (
    <Provider store={store}>
      <Router>
        <div className="App">
          <Switch>
            <Route path="/personagens">
              <Characters characterId={1} />
            </Route>
            {/* Outras rotas podem ser configuradas aqui */}
          </Switch>
        </div>
      </Router>
    </Provider>
  );
}

export default App;
